        return new Source("{% extends 'base.html.twig' %}

{% block title %}Connexion{% endblock %}

{% block body %}
<div class=\"container\">
{% if error %}
    <div>{{ error.messageKey|trans(error.messageData, 'main') }}</div>
{% endif %}
    
    <form action=\"{{ path('app_backoffice_login') }}\" method=\"post\">
        <label class=\"form-label\" for=\"username\">Email:</label>
        <input class=\"form-control\" type=\"text\" id=\"username\" name=\"_username\" value=\"{{ last_username }}\"/>

        <label class=\"form-label\" for=\"password\">Mot de passe:</label>
        <input class=\"form-control\" type=\"password\" id=\"password\" name=\"_password\"/>

        {# If you want to control the URL the user is redirected to on success #}
        <input type=\"hidden\" name=\"_target_path\" value=\"{{ path('app_backoffice_home') }}\"/>

        <button class=\"my-4 btn btn-success\" type=\"submit\">Se connecter</button>
    </form>

</div>
{% endblock %}", "backoffice/main/login.html.twig", "/var/www/html/Protons/ODicey/projet-04-o-dicey-back/templates/backoffice/main/login.html.twig");
